//import logo from './logo.svg';

import React from 'react';
import { HomePage } from './homePage.js';

function App(props) {
    return (
      <div className="App">
        <header className="App-header">
          <h1>hello</h1>
          <Homepage snackSwap={props.food}></Homepage>
        </header>
      </div>
    );
}

export default App;
